import React from 'react';
import { Layout, Button} from 'antd';
import {
    BankOutlined,
    ArrowLeftOutlined,
    ArrowRightOutlined,
    CaretRightOutlined,
    ZoomInOutlined,
    ZoomOutOutlined,
    RedoOutlined,
    UndoOutlined,
    StepForwardOutlined
  } from '@ant-design/icons';
import {Link} from "react-router-dom";

// http://315v841f37.zicp.vip/

class SeriesViewerTable extends React.Component {
    constructor(props) {
        super(props);
        this.setState.bind(this);
      }
      render() {
        const { Header } = Layout;
        return (
          <div>
             <Layout>
              <Header style={{ position: 'fixed', zIndex: 1, width: '100%' }}>
                <Link to='/studies'>
                    <BankOutlined style={{color:'white', fontSize:30, width:100}}/>               
                </Link>
                <ArrowLeftOutlined style={{color:'white', fontSize:30}}/>
                <ArrowRightOutlined style={{color:'white', fontSize:30}}/>
                <CaretRightOutlined style={{color:'white', fontSize:30}}/>
                <Button style={{color:'white', size:30}}/>
                <ZoomInOutlined style={{color:'white', fontSize:30}}/>
                <ZoomOutOutlined style={{color:'white', fontSize:30}}/>
                <RedoOutlined style={{color:'white', fontSize:30}}/>
                <UndoOutlined style={{color:'white', fontSize:30}}/>
              </Header>
            </Layout>

          </div>
          )
      }
}
export default SeriesViewerTable;
